function ContactList() {
    const [choosenList, setList] = useState(List);
    console.log(choosenList);

    let sortPop = () => {
        const byYearDown = choosenList.sort(compareDateAc);

        setList(byYearDown);
        console.log(byYearDown);
        // console.log(byYearDown);
    };

    function compareDateAc(a, b) {
        if (a.name < b.name) {
            return -1;
        }
        if (a.name > b.name) {
            return 1;
        }
        return 0;
    }
    return (
        <section>
            <div className='buttonDiv'><button onClick={sortPop}>Sort ny Name</button><button>Sort by Popularity</button></div>
            <div className='header'>
                <h1>Picture</h1>
                <h1>Name</h1>
                <h1>Popularity</h1>
            </div>
            {choosenList.map((item) => {
                return (<ContactItem name={item.name} url={item.pictureUrl} pop={item.popularity} />
                );
            })}
        </section>

    );
}

export default ContactList;
